INSERT INTO `parts` VALUES (1,'Brake Pad','In disc-brake systems, the brake pads are the friction material the caliper squeezes against the rotating disc, or rotor, to slow the wheel’s rotation and stop the car. In drum brakes, the pads are called shoes.<br />Subject to tremendous friction and heat, brake pads wear down and must be replaced as part of a car’s regular maintenance. How long they last depends both on the car’s design and how it is driven.',51.00,249.00,'2016-04-16 12:50:26','2016-04-16 18:42:21'),(2,'Battery','The battery stores and supplies the electrical energy used by the starter to initially start the engine. When the vehicle is running, the battery serves as backup power if the alternator cannot meet the electrical demands of the vehicle.',79.00,149.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(3,'Drive Belt(s)','These belts can be used individually or grouped together as part of the belt/pulley system that is driven by the engine crankshaft to run such items as the air conditioning compressor, alternator, and power steering pump.',31.00,89.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(4,'Front Brake Pad Set with Resurfaced Rotors','When the brakes are applied, the brake pads are forced against the brake rotor, which causes the brake rotor to begin slowing down. This is what slows down and stops your vehicle.',51.00,145.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(5,'Rear Brake Pad Set with Resurfaced Rotors','When the brakes are applied, the brake pads are forced against the brake rotor, which causes the brake rotor to begin slowing down. This is what slows down and stops your vehicle.',71.00,104.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(6,'Automatic Transmission Fluid (ATF) Quart (11)','Automatic transmission fluid is a lightweight oil that is used to operate the hydraulic mechanisms in an automatic transmission, provide lubrication, and act as a coolant for the transmission. When new, it\'s usually a cranberry red color.',66.00,88.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(7,'Coolant','Coolant is the fluid that flows through the engine\'s cooling system. Its main purpose is to transfer heat generated by the engine to the radiator so the engine doesnÕt overheat.',16.00,225.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(8,'Engine Oil','Engine oil provides lubrication for all internal moving parts of an engine. It also helps conduct heat away from these components.',27.00,60.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(9,'Oil Filter','The engine oil filter removes contaminants from the engine oil before it circulates throughout the engine.',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(10,'Oil Drain Plug Gasket','The oil drain plug gasket seals the oil drain plug where it connects to the oil pan.',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(11,'Exhaust Manifold (2)','The exhaust manifold collects the exhaust gas from each cylinder head and routes it through the rest of the exhaust system.',265.00,316.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(12,'Exhaust Manifold Gasket Set','The exhaust manifold gasket is the working seal between the exhaust manifold and the cylinder head.',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(13,'Exhaust Manifold to Down Pipe Gasket (2)','',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(14,'Power Steering Fluid','Power steering fluid is an oil specially formulated for use in power steering systems.',154.00,205.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(15,'Power Steering Pump','The power steering pump provides the hydraulic pressure necessary to operate the power steering system.',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(16,'Wheel Bearing Seal (2)','',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05'),(17,'Grease(2)','',0.00,0.00,'2016-04-16 12:50:26','2016-04-16 18:24:05');
