INSERT INTO `services` VALUES (1,'Batteries','This service includes replacement and proper disposal of existing batteries, and removal of corrosion from battery cable terminals. This will help your battery provide dependable starting power, along with the power to run the interior and exterior lighting, power seats, windows and radio. See the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,57.00,73.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(2,'Belts & Hoses','This service includes replacing worn belts and hoses, and adjusting the fit of installed components. It is a good idea to check the condition of your vehicle’s belts and hoses with every oil change. Replacing belts and hoses will help avoid unexpected breakdowns, and serious engine damage due to overheating. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition',NULL,57.00,73.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(3,'Brake Systems Repair','This service includes replacement of worn brake pads and brake shoes, resurfacing brake rotors or drums, and replacing brake fluid as needed. It’s important to have your brakes checked at least once a year to keep them responsive, and avoid costly replacements. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,191.00,500.00,'Automotive',0,NULL,'2016-04-19 03:26:22'),(4,'Drivelines','This service includes measuring and refilling the transmission fluid, inspecting the CV and universal joints for loss of lubricant or excessive movement, and checking for noises or vibration during acceleration. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,105.00,134.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(5,'Electrical Systems','This service provides a thorough check of the car battery and case condition, the cable connections, and the vehicle’s charging system. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,96.00,122.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(6,'Engine Diagnostics','To thoroughly check your engine diagnostics a certified technician transmits information from your vehicle’s computer into a diagnostic tool. This diagnostic tool provides the technician with the necessary information to properly diagnose why your vehicle’s check engine light is illuminated. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,96.00,122.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(7,'Fluid Exchange Services','For this service, fluids are filled to the proper level, and are checked for cleanliness and leaks. This helps the engine and vehicle operate properly. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,0.00,0.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(8,'Heating & Coolant Systems','This service includes the removal and replacement of engine coolant using state of art equipment. Properly maintaining these systems helps the engine operate at an optimal temperature to extend the efficiency of your radiator and cooling system components, and avoid expensive replacements. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,86.00,110.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(9,'Air Conditioning','In this service, the air conditioning system is checked for refrigerant leaks and the interior cabin temperature is evaluated. This helps provide a comfortable temperature inside the vehicle, and reduces the risk of premature compressor failure. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,96.00,122.00,'Maintenance',0,NULL,'2016-04-18 04:10:39'),(10,'Oil, Lube & Filter Services','In these services, oil filters are changed, air filters are checked, all fluids under the hood are checked and filled, fittings are lubricated, and the engine is checked for leaks, among other things. For optimal results, visit the experts at Angel\'s Auto Repair Shop every 3,000 miles for an oil change',NULL,27.00,60.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(11,'Mufflers & Exhaust','This service replaces exhaust components that are broken, missing, or not performing their intended function. Properly maintaining these systems helps minimize engine noise, protects you and others from harmful gases, and reduces pollutants released into the atmosphere. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition',NULL,316.00,402.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(12,'Steering & Suspension Systems','This service replaces worn, damaged or missing steering or suspension parts that are not performing as intended. Properly maintaining your vehicle’s suspension helps restore ride comfort and handling performance. It can also save you hundreds of dollars by eliminating premature tire wear. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,134.00,171.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(13,'Tune-Ups','A tune up replaces faulty components, and uses computerized diagnostic equipment to evaluate vital electronic engine components, like oxygen sensors and the control module. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition',NULL,39.00,831.00,'Automotive',0,NULL,'2016-04-16 18:37:01'),(14,'Tire Repair','To properly repair a tire with minor damage, it’s necessary to dismount the tire, inspect it for damage, determine if the tire is suitable for repair, and patch it from the inside using proper patching materials and techniques. Goodyear Tire & Service Network retailers have the experts and equipment to make proper repairs, rebalance your tire & wheel assembly, and reset/reactivate your tire pressure monitoring system (if applicable).',NULL,20.00,25.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(15,'Tire Installation','This service includes inspecting the lug nuts for wear, installing new valve stems, and mounting and balancing the tires, among other things. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,13.00,180.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(16,'Wheel and Tire Balancing','This service checks the placement of weight around a tire and rim assembly. This minimizes vibrations that can be felt in the steering wheel, seat, and floorboards, and helps tires wear evenly. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,153.00,195.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(17,'Tire Rotation','Rotating your tires means moving them from one side of the vehicle to the other, moving them from front to back, or a combination of both. Since front tires tend to wear faster than rear tires on front wheel drive vehicles, due to added pressure and resistance from steering, regular tire rotation is key. This will help avoid uneven tire wear, which can lead to poor performance and decreased gas mileage. Some tires must be rotated at specific intervals, while others need to be rotated depending on the wear. To rotate your tires properly, visit the experts at Angel\'s Auto Repair Shop.',NULL,29.00,37.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(18,'Wheel Alignment','n this service, the wheel angles are measured and corrected so that they’re set to vehicle manufacturer specifications for optimum tire wear and handling results. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,96.00,122.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(19,'Tire Pressure','Getting your Tire Pressure Monitoring System checked involves testing the tire pressure and tire sensors to diagnose the problem. Maintaining this system helps improve vehicle handling and fuel economy, decreases tire wear, and reduces braking distance. Visit the experts at Angel\'s Auto Repair Shop for this and other services to keep your vehicle in excellent condition.',NULL,0.00,0.00,'Tire',0,NULL,'2016-04-16 18:37:01'),(20,'Air Filter','In order to run, the engine needs a precise mixture of fuel and air. When outside air is drawn into the engine, the air filter prevents harmful dirt and debris from entering the system.',NULL,NULL,NULL,'Maintenance',0,NULL,'2016-04-19 01:55:14'),(21,'Cabin Air Filter','The cabin air filter prevents dust, pollen, and other debris from entering the passenger compartment through the climate control (HVAC) system.',NULL,NULL,NULL,'Maintenance',0,NULL,'2016-04-19 02:02:09');
